import React, { Fragment } from "../../../img/header_logo/";
import "./style.scss"

function navbar() {
    return(
        <Fragment>
            <div className="imagen"></div>
            <header>
                <div className="logo">
                <img src="../../../img/header_logo/"></img>
                </div>
            </header>
            
            
            
        </Fragment>
   )
    
}

export default navbar

